import React, { Component } from 'react';
import store from "../Store";

var pic = 0;
class Stack extends Component {

  componentWillMount(){
    var number = Math.floor(Math.random()*10);
    var pointsAB = [3116, 3623, 2929, 2923, 3129, 2927, 2816, 3123, 3634, 2916];
    var picarray = ["data:image/png;base64,","data:image/png;base64,","data:image/png;base64,","data:image/png;base64,","data:image/png;base64,","data:image/png;base64,","data:image/png;base64,","data:image/png;base64,","data:image/png;base64,","data:image/png;base64,"]
    pic = picarray[number];
    this.setState({pointA: Math.floor(pointsAB[number]/100)});
    this.setState({pointB: pointsAB[number] - Math.floor(pointsAB[number]/100)*100});
    console.log(number);
    console.log("--------------------------");
  }

  constructor(props){
    super(props);
    this.state = {
      pointA: 0,
      pointB: 0,
      value: 0
    };
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(event){
    this.setState({value: event.target.value})
  }
  
  handleValue = () => {
    store.dispatch({
      type:"stack",
      value: this.state.value,
      pointAstack: this.state.pointA,
      pointBstack: this.state.pointB
    })
    console.log(Math.floor(Math.random()*10 + 1));
    console.log(this.state);
    console.log(this.state.value);
    console.log(store.getState());
  }

  handleClick = () => {
    this.props.history.push("/submit")
  }
  
  
  render() {
    return (
      <div>
        <h1>barchart</h1>
          <div>
            <a>Please Input the ratio of the two areas where white points in(Bigger/Smaller)</a>
            <br/>
            <input type="text" value={this.state.value} onChange={this.handleChange}></input>
            <button onClick={this.handleValue()}> submit </button>
            <button onClick = {this.handleClick} >next</button>
          </div>
          <img src={pic} alt="test" width="420" height="400"/>
      </div>

    );
  }
}

export default Stack;